import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { QueryClient, QueryClientProvider } from 'react-query';
import { Toaster } from 'react-hot-toast';
import { AuthProvider } from './contexts/AuthContext';

// Layouts
import AuthLayout from './components/layout/AuthLayout';
import DashboardLayout from './components/layout/DashboardLayout';

// Auth Pages
import Login from './pages/auth/Login';
import Register from './pages/auth/Register';
import ForgotPassword from './pages/auth/ForgotPassword';
import ResetPassword from './pages/auth/ResetPassword';

// Dashboard Pages
import Dashboard from './pages/applicant/Dashboard';
import JobsPage from './pages/applicant/JobsPage';
import ScholarshipsPage from './pages/applicant/ScholarshipsPage';
import ApplicationsPage from './pages/applicant/ApplicationsPage';
import ProfilePage from './pages/applicant/ProfilePage';
import ChatPage from './pages/applicant/ChatPage';

// Admin Pages
import AdminDashboard from './pages/admin/Dashboard';
import AdminJobsPage from './pages/admin/JobsPage';
import AdminScholarshipsPage from './pages/admin/ScholarshipsPage';
import AdminApplicantsPage from './pages/admin/ApplicantsPage';
import AdminAdsPage from './pages/admin/AdsPage';
import AdminChatPage from './pages/admin/ChatPage';
import StaffManagementPage from './pages/admin/StaffManagementPage';

// Other Pages
import ApplicationWizard from './pages/wizard/ApplicationWizard';
import NotFound from './pages/error/NotFound';
import Debug from './pages/Debug';

// Protected Route Component
import ProtectedRoute from './components/ProtectedRoute';
import RoleBasedRedirect from './components/RoleBasedRedirect';

// Create a client
const queryClient = new QueryClient({
  defaultOptions: {
    queries: {
      retry: 1,
      refetchOnWindowFocus: false,
    },
  },
});

function App() {
  return (
    <QueryClientProvider client={queryClient}>
      <AuthProvider>
        <Router>
          <div className="min-h-screen bg-gray-50">
            <Toaster
              position="top-right"
              toastOptions={{
                duration: 4000,
                style: {
                  background: '#363636',
                  color: '#fff',
                },
                success: {
                  duration: 3000,
                  iconTheme: {
                    primary: '#4ade80',
                    secondary: '#fff',
                  },
                },
                error: {
                  duration: 5000,
                  iconTheme: {
                    primary: '#ef4444',
                    secondary: '#fff',
                  },
                },
              }}
            />

            <Routes>
              {/* Debug Route */}
              <Route path="/debug" element={<Debug />} />

              {/* Redirect /login to /auth/login for convenience */}
              <Route path="/login" element={<Navigate to="/auth/login" replace />} />

              {/* Auth Routes */}
              <Route path="/auth" element={<AuthLayout />}>
                <Route path="login" element={<Login />} />
                <Route path="register" element={<Register />} />
                <Route path="forgot-password" element={<ForgotPassword />} />
                <Route path="reset-password" element={<ResetPassword />} />
              </Route>

              {/* Protected Routes */}
              <Route path="/" element={
                <ProtectedRoute>
                  <DashboardLayout />
                </ProtectedRoute>
              }>
                {/* Applicant Routes */}
                <Route path="dashboard" element={<Dashboard />} />
                <Route path="jobs" element={<JobsPage />} />
                <Route path="scholarships" element={<ScholarshipsPage />} />
                <Route path="applications" element={<ApplicationsPage />} />
                <Route path="profile" element={<ProfilePage />} />
                <Route path="chat" element={<ChatPage />} />

                {/* Admin Routes */}
                <Route path="admin" element={
                  <ProtectedRoute allowedRoles={['admin']}>
                    <AdminDashboard />
                  </ProtectedRoute>
                } />
                <Route path="admin/jobs" element={
                  <ProtectedRoute allowedRoles={['admin', 'staff']}>
                    <AdminJobsPage />
                  </ProtectedRoute>
                } />
                <Route path="admin/scholarships" element={
                  <ProtectedRoute allowedRoles={['admin', 'staff']}>
                    <AdminScholarshipsPage />
                  </ProtectedRoute>
                } />
                <Route path="admin/applicants" element={
                  <ProtectedRoute allowedRoles={['admin', 'staff']}>
                    <AdminApplicantsPage />
                  </ProtectedRoute>
                } />
                <Route path="admin/ads" element={
                  <ProtectedRoute allowedRoles={['admin', 'staff']}>
                    <AdminAdsPage />
                  </ProtectedRoute>
                } />
                <Route path="admin/chat" element={
                  <ProtectedRoute allowedRoles={['admin', 'staff']}>
                    <AdminChatPage />
                  </ProtectedRoute>
                } />
                <Route path="admin/staff" element={
                  <ProtectedRoute allowedRoles={['admin']}>
                    <StaffManagementPage />
                  </ProtectedRoute>
                } />

                {/* Application Wizard */}
                <Route path="apply/:type/:id" element={<ApplicationWizard />} />

                {/* Default redirect */}
                <Route index element={<RoleBasedRedirect />} />
              </Route>

              {/* 404 Route */}
              <Route path="*" element={<NotFound />} />
            </Routes>
          </div>
        </Router>
      </AuthProvider>
    </QueryClientProvider>
  );
}

export default App;
